import React from "react";

import "./Footer.css";

const Footer = () => {
  return (
    <footer id="footer">
      <div className="midFooter">
        <p>&copy; 24x7 Online Pharmacy Store</p>
      </div>
    </footer>
  );
};

export default Footer;
